import { NavLink } from "react-router-dom";

const Menu = () => {
    return(
    <>
    <NavLink exact activeClassName="menu_sty" to="/"> About US </NavLink>
    <NavLink exact activeClassName="active_name" to="/contact"> Contact </NavLink>
    <br />
        <a href="/"> About us </a>
        <a href="/contact"> Contact </a>
        <a href="/services"> Services </a>
    </>

    )
};
export default Menu;
